                    style={{ objectPosition: 'center top' }}
                />

                <div className="absolute top-3 left-3 z-20">
                    <span className={`px-2 py-1 text-xs font-medium rounded-full backdrop-blur-sm flex items-center gap-1 ${getCategoryColor(project.category)}`}>
                        {getCategoryIcon(project.category)}
                        {project.category}
                    </span>
                </div>

                <div className="absolute top-3 right-3 z-20">
                    <span className={`px-2 py-1 text-xs font-medium rounded-full backdrop-blur-sm flex items-center gap-1 ${getStatusColor(project.status)}`}>
                        {isIncomplete(project.status) ? <Clock size={12} /> : <CheckCircle size={12} />}
                        {isIncomplete(project.status) ? 'In Progress' : 'Completed'}
                    </span>
                </div>
            </div>

            <div className="p-4 sm:p-6 flex flex-col flex-grow">
                <h3 className={`text-lg sm:text-xl font-bold mb-2 transition-colors ${
                    isIncomplete(project.status) 
                        ? 'text-yellow-400 group-hover:text-yellow-300' 
                        : 'text-theme-primary group-hover:text-blue-400'
                }`}>
                    {project.title}
                    {isIncomplete(project.status) && (
                        <span className="ml-2 text-xs bg-yellow-600/20 text-yellow-400 px-2 py-1 rounded-full">
                            WIP
                        </span>
                    )}
                </h3>

                <p className="text-theme-secondary mb-4 sm:mb-5 text-xs sm:text-sm min-h-[40px] sm:min-h-[60px] leading-relaxed">
                    {project.description}
                </p>

                <div className="flex gap-3 sm:gap-4 mt-auto">
                    <motion.a
                        href={project.github}
