                        <span className="font-medium text-sm">Code</span>
                    </motion.a>
                    {project.demo && (
                        <motion.a
                            href={project.demo}
                            target="_blank"
                            rel="noopener noreferrer"
                            className={`flex items-center gap-1 sm:gap-2 px-3 sm:px-4 py-1.5 sm:py-2 rounded-lg transition-all duration-300 border ${
                                isIncomplete(project.status)
                                    ? 'border-yellow-500/30 hover:bg-yellow-600 text-yellow-400 hover:text-white'
                                    : 'border-blue-500/30 hover:bg-blue-600 text-blue-400 hover:text-white'
                            }`}
                            whileHover={{ scale: 1.03 }}
                            whileTap={{ scale: 0.97 }}
                        >
                            <ExternalLink size={16} />
                            <span className="font-medium text-sm">Demo</span>
                        </motion.a>
                    )}
                </div>
            </div>
        </motion.div>
    );

    return (
        <div className="mt-16 sm:mt-20 px-1">
            <div className="flex items-center justify-between mb-8">
                <h2 className="text-3xl font-bold text-theme-primary">Featured Projects</h2>
