import { motion } from 'framer-motion';

function ProjectCard({ project, variants }) {
    const getCategoryIcon = (category) => {
        switch (category) {
            case 'Mobile App':
                return <Smartphone size={14} />;
            case 'Web App':
                return <Monitor size={14} />;
            default:
                return null;
        }
    };

    const getCategoryColor = (category) => {
        const colors = {
            'AI/ML': 'bg-purple-600/90 text-white',
            'Web App': 'bg-blue-600/90 text-white',
            'Mobile App': 'bg-green-600/90 text-white',
            'Game': 'bg-red-600/90 text-white',
            'Creative Tool': 'bg-orange-600/90 text-white',
        };
        return colors[category] || 'bg-gray-600/90 text-white';
    };

    const isIncomplete = (status) => {
        return status !== 'completed';
    };

    // Map skills to their corresponding icon filenames
    const getSkillIcon = (skill) => {
        const skillIconMap = {
            'Next.js': 'nextjs.svg',
            'React': 'react.svg',
            'React Native': 'reactnative.svg',
            'Node.js': 'expressjs.svg', // Using express as Node.js representation
            'JavaScript': 'javascript.svg',
            'TypeScript': 'typescript.svg',
            'Python': 'python.svg',
            'Golang': 'golang.svg',
            'Go': 'golang.svg',
            'FastAPI': 'fastapi.svg',
            'Fiber': 'fiber.svg',
            'Prisma': 'prisma.svg',
            'Redis': 'redis.svg',
            'MongoDB': 'mongodb.svg',
            'PostgreSQL': 'postgresql.svg',
            'MySQL': 'mysql.svg',
            'SQLite': 'sqlite.svg',
            'Docker': 'docker.svg',
            'TailwindCSS': 'tailwindcss.svg',
            'Vite': 'vite.svg',
            'Clerk': 'clerk.svg',
            'Expo': 'expo.svg',
            'expo': 'expo.svg',
            'Gemini': 'gemini.svg',
            'LangChain': 'langchain.svg',
            'Pinecone': 'pinecone.svg',
            'Socket.IO': 'socketio.svg',
            'Selenium': 'selenium.svg',
            'Zustand': 'zustand.svg',
            'Gorilla WebSockets': 'websocket.svg',
            'WebSockets': 'websocket.svg',
            'RabbitMQ': 'rabbitmq.svg',
            'Kubernetes': 'kubernetes.svg',
            'Nginx': 'nginx.svg',
            'gRPC': 'grpc.svg',
            'Framer Motion': 'react.svg', // Using React icon as fallback
            'Express': 'expressjs.svg',
            'Flask': 'python.svg', // Using Python icon for Flask
            'NativeWind': 'tailwindcss.svg', // Using TailwindCSS icon for NativeWind
            'NewsAPI': 'javascript.svg', // Using JS icon as fallback
            'Convex': 'javascript.svg', // Using JS icon as fallback
            'BullMQ': 'redis.svg', // Using Redis icon as BullMQ uses Redis
            'Supabase': 'postgresql.svg', // Using PostgreSQL icon for Supabase
            'Kafka': 'javascript.svg', // Using JS icon as fallback
            'CI/CD': 'docker.svg', // Using Docker icon as fallback
            'AWS': 'javascript.svg', // Using JS icon as fallback
        };

        return skillIconMap[skill] || null;
    };

    // Get available skill icons for the project
    const getAvailableSkillIcons = (skills) => {
        const availableIcons = [];
        const unavailableCount = skills.filter(skill => {
            const iconPath = getSkillIcon(skill);
            if (iconPath) {
                availableIcons.push({ skill, iconPath });
                return false;
            }
            return true;
        }).length;

        return { availableIcons, unavailableCount };
    };

    const renderSkillIcons = () => {
        if (!project.tech || project.tech.length === 0) return null;

        const { availableIcons, unavailableCount } = getAvailableSkillIcons(project.tech);
        const maxVisible = 5;
        const visibleIcons = availableIcons.slice(0, maxVisible);
        const remainingCount = (availableIcons.length - maxVisible) + unavailableCount;

        return (
            <div className="flex items-center mb-4">
                <div className="flex items-center">
                    {visibleIcons.map((item, index) => (
                        <div
                            key={item.skill}
                            className="relative"
                            style={{ 
                                marginLeft: index > 0 ? '-6px' : '0',
                                zIndex: visibleIcons.length - index 
                            }}
                        >
                            <div className="w-8 h-8 bg-element border-2 border-card rounded-full flex items-center justify-center p-1 hover:scale-110 transition-transform duration-200">
                                <img
                                    src={`/icons/${item.iconPath}`}
                                    alt={item.skill}
                                    className="w-4 h-4 object-contain"
                                    title={item.skill}
                                />
                            </div>
                        </div>
                    ))}

                    {remainingCount > 0 && (
                        <div
                            className="relative w-8 h-8 bg-element border-2 border-card rounded-full flex items-center justify-center text-xs font-semibold text-theme-primary hover:scale-110 transition-transform duration-200"
                            style={{ 
                                marginLeft: visibleIcons.length > 0 ? '-6px' : '0',
                                zIndex: 0
                            }}
                            title={`+${remainingCount} more technologies`}
                        >
                            +{remainingCount}
                        </div>
                    )}
                </div>
            </div>
        );
    };

    return (
        <motion.div
            className={`group rounded-xl overflow-hidden shadow-lg hover:shadow-2xl bg-card flex flex-col transition-all duration-300 border ${
                isIncomplete(project.status) 
                    ? 'border-yellow-500/30 hover:border-yellow-400/50 bg-gradient-to-br from-card to-yellow-900/5' 
